import React, { useEffect, useState, useCallback } from "react";
import axios from "axios";
import TaskBoard from "./components/TaskBoard";
import ContactBoard from "./components/ContactBoard";
import ProgressDashboard from "./components/ProgressDashboard";
import ThemeOfTheMonth from "./components/ThemeOfTheMonth";
import {
  AppBar, Toolbar, Typography, Button, Container, Box, Snackbar, Paper, useTheme, Slide
} from "@mui/material";

function getToken() { return localStorage.getItem('token'); }
function setToken(token) { localStorage.setItem('token', token); }
function removeToken() { localStorage.removeItem('token'); }
function authHeaders() { return { Authorization: "Bearer " + getToken() }; }

function AuthForm({ onLogin }) {
  // ... (identique à avant mais plus clean, cf plus haut)
  // Ici je passe à l'essentiel, dis-moi si tu veux la version complète stylisée.
  // Le reste du code reste inchangé, sauf layout/colors/snackbar.
}

export default function App() {
  const [user, setUser] = useState(null);
  const [page, setPage] = useState("loading");
  const [tasks, setTasks] = useState([]);
  const [contacts, setContacts] = useState([]);
  const [users, setUsers] = useState([]);
  const [githubStatus, setGithubStatus] = useState('');
  const [snack, setSnack] = useState('');
  const theme = useTheme();

  // ... logique business identique

  if (page === "loading") return <Box sx={{ mt: 10, textAlign: "center" }}>Chargement…</Box>;
  if (page === "auth") return <AuthForm onLogin={loadUserAndData} />;

  return (
    <Box sx={{ background: theme.palette.background.default, minHeight: "100vh" }}>
      {/* NAVBAR */}
      <AppBar position="sticky" color="primary" elevation={0}>
        <Toolbar sx={{ justifyContent: "space-between" }}>
          <Typography variant="h6" sx={{ fontWeight: 700, letterSpacing: 1 }}>
            Dashboard Collaboratif
          </Typography>
          <Box>
            <Typography component="span" sx={{ mr: 2, fontWeight: 500 }}>
              Connecté en tant que <b style={{ color: theme.palette.secondary.main }}>{user?.username}</b>
            </Typography>
            <Button color="inherit" onClick={logout}>SE DÉCONNECTER</Button>
          </Box>
        </Toolbar>
      </AppBar>
      {/* THEME DU MOIS */}
      <ThemeOfTheMonth />
      <Container maxWidth="md" sx={{ py: 4 }}>
        {/* Actions principales */}
        <Box sx={{ display: "flex", gap: 2, mb: 3, flexWrap: "wrap" }}>
          <Button variant="contained" onClick={() => saveToGitHub(setGithubStatus)}>
            SAUVEGARDER SUR GITHUB
          </Button>
          <Button variant="outlined" onClick={exportJSON}>EXPORTER EN JSON</Button>
          <Typography sx={{ color: "#888", alignSelf: "center" }}>{githubStatus}</Typography>
        </Box>
        <Paper elevation={2} sx={{ px: {xs:2, md:4}, py: 3, mb: 4, borderRadius: 4, border: "1.5px solid #1a6fa522" }}>
          <ProgressDashboard tasks={tasks} />
        </Paper>
        <TaskBoard
          tasks={tasks}
          users={users}
          onAdd={handleTaskAdd}
          onUpdate={handleTaskUpdate}
          onDelete={handleTaskDelete}
          currentUser={user}
        />
        <ContactBoard
          contacts={contacts}
          onAdd={handleContactAdd}
          onUpdate={handleContactUpdate}
          onDelete={handleContactDelete}
          currentUser={user}
        />
      </Container>
      <Snackbar
        open={!!snack}
        autoHideDuration={2000}
        onClose={() => setSnack('')}
        message={snack}
        TransitionComponent={Slide}
      />
    </Box>
  );
}
